import React from 'react'
import {PortfolioInfo} from './PortfolioInfo'

const Portfolio = () => {
    return (
        <>
           {PortfolioInfo.map((item) => {
               console.log(item)
               return(
                   <img src={item.image}/>
               )
           })};
        </>
    )
}

export default Portfolio
